import React, { useEffect } from "react";
import { Container } from "./Homepage.style";
import { Button, Image, Navbar } from "react-bootstrap";
import useLog from "../../hooks/useLog";
import rock from "./../../media/images/Concert Muzica Rock.jpg";
import "./../../media/images/Concert Jazz.png";
import "./../../media/images/Concert Muzica Clasica.png";
import Slider from "../carousel/Carousel";
import NavBar from "../NavBar/NavBar";
import TopEvents from "../TopEventsGroupCards/TopEvents.jsx";

const Homepage = () => {
  useLog("Salut", "err");
  return (
    <Container>
      <Slider></Slider>

      {/* Ending Card */}

      <div class="card text-center">
        <div class="card-header">MyEvent.ro</div>
        <div class="card-body">
          <h5 class="card-title">Locul distractie tale</h5>
          <p class="card-text">
            With supporting text below as a natural lead-in to additional
            content.
          </p>
          <a href="" class="btn btn-primary">
            Cumpara Bilete
          </a>
        </div>
        <div class="card-footer text-body-secondary"></div>
      </div>
      <div class="text-center p-1 text-dark">
        <h2 className="mt-4">Top Events</h2>
      </div>
      <TopEvents></TopEvents>
    </Container>
  );
};

export default Homepage;
